B.P9=new A.dL("Livre de recettes",'                  <h2>Antidote d\'orage</h2>\n                  <p>\n                    Utilis\xe9 la nuit, cet antidote gu\xe9rit des br\xfblures caus\xe9es par la foudre.\n                  </p>\n                  <p>\n                    <strong>~ Ingr\xe9dients ~</strong>\n                  </p>\n                  <img src="asset:assets/objects/champinum-enigma.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/healing-potion.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/medusa.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/purple-crystals.svg" height="72">\n                  <h2>Bouillon d\'illusions</h2>\n                  <p>\n                    Gare \xe0 celui qui humera ce bouillon : il sera sit\xf4t victime d\'illusions et d\'hallucinations.\n                  </p>\n                  <p>\n                    <strong>~ Ingr\xe9dients ~</strong>\n                  </p>\n                  <img src="asset:assets/objects/enchanted-spices.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/forest-cards.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/voeilette.svg" height="72">\n                  <h2>\xc9lixir de gu\xe9rison</h2>\n                  <p>\n                    Cet \xe9lixir, une fois consum\xe9, permet la gu\xe9rison de tous types de blessures physiques.\n                  </p>\n                  <p>\n                    <strong>~ Ingr\xe9dients ~</strong>\n                  </p>\n                  <img src="asset:assets/objects/healing-potion.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/happiness-mirror.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/hericorne-claw.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/medusa.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/purple-crystals.svg" height="72">\n                  <h2>Fiole de col\xe8re</h2>\n                  <p>\n                    Le contenu de cette fiole rend son consommateur imm\xe9diatement fou de rage.\n                  </p>\n                  <p>\n                    <strong>~ Ingr\xe9dients ~</strong>\n                  </p>\n                  <img src="asset:assets/objects/champinum-enigma.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/hericorne-claw.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/scaribo.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/voeilette.svg" height="72">\n                  <h2>M\xe9lange de d\xe9mence</h2>\n                  <p>\n                    Un m\xe9lange sugg\xe9r\xe9 par les d\xe9mons eux-m\xeames, dont la seule vision provoque des troubles schizophr\xe9niques.\n                  </p>\n                  <p>\n                    <strong>~ Ingr\xe9dients ~</strong>\n                  </p>\n                  <img src="asset:assets/objects/champinum-enigma.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/medusa.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/purple-crystals.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/voeilette.svg" height="72">\n                  <h2>Philtre d\'amour</h2>\n                  <p>\n                    Fabriqu\xe9 \xe0 l\'aide de plantes magiques, ce philtre permet de faire tomber amoureuses deux personnes qui le boivent.\n                  </p>\n                  <p>\n                    <strong>~ Ingr\xe9dients ~</strong>\n                  </p>\n                  <img src="asset:assets/objects/enchanted-spices.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/forest-cards.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/healing-potion.svg" height="72">\n                  <h2>Potion de sommeil</h2>\n                  <p>\n                    La simple odeur de cette potion permet de faire tomber instantan\xe9ment son consommateur dans un profond sommeil d\'une dur\xe9e de plusieurs jours.\n                  </p>\n                  <p>\n                    <strong>~ Ingr\xe9dients ~</strong>\n                  </p>\n                  <img src="asset:assets/objects/champinum-enigma.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/enchanted-spices.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/happiness-mirror.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/hericorne-claw.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/scaribo.svg" height="72">\n                  <h2>Tonique de silence</h2>\n                  <p>\n                    Malheur \xe0 celui qui ingurgitera ce tonique : il verra sa m\xe2choire compl\xe8tement paralys\xe9e pendant trois mois.\n                  </p>\n                  <p>\n                    <strong>~ Ingr\xe9dients ~</strong>\n                  </p>\n                  <img src="asset:assets/objects/enchanted-spices.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/happiness-mirror.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/medusa.svg" height="72">\n                  &nbsp;<img src="asset:assets/objects/purple-crystals.svg" height="72">\n                  ',t.o)
